    [],nt"revision_timestamp": "2016-07-27T22:46:32.560275",nt"name": "lacreek-national-wildlife-refuge-narrative-report-may-june-july-august-1950",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Lacreek National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1950.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    big game animals, furbearers, predators, rodents, raptors, and fish- is also covered.
    The Refuge development and maintenance section discusses physical developments,
    plantings, and wildfires. Resource management is outlined; topics include grazing
    and haying. The public relations section of the report describes recreational uses,
    Refuge visitors, Refuge participation, fishing, and violations. N-R forms and photographs
    are attached.",nt"license_title": "License Not Specified",nt"extras":
